   "source": [
    "**Clone size**: - This indicates the size of the plant clone, which can be related to the potential yield.\n",
    "\n",
    "**Pollinators**: honeybee, bumbles, andrena, and osmia - These values represent the relative abundance or activity of different pollinator species, which can significantly impact the fruit set and yield.\n",
    "\n",
    "**Temperature ranges**: The data includes maximum, minimum, and average values for both upper and lower temperature ranges. Temperature can affect plant growth and yield, as well as pollinator activity.\n",
    "\n",
    "**Raining days and average raining days** - These values indicate the number of days with rainfall and the average amount of rain per day, which can impact plant growth and yield.\n",
    "\n",
    "**Fruit set and fruit mass** - These values give an indication of the overall fruit production and size, which can be used to estimate yield.\n",
    "\n",
    "**Seeds** - This value represents the average number of seeds produced, which can be related to the potential yield."
   ]
  },
