    "# Assuming 'cor_matrix' is your correlation matrix\n",
    "cor_matrix <- cor(train_set)  # Example data\n",
    "\n",
    "# Reshape the correlation matrix for plotting\n",
    "cor_matrix_melted <- reshape2::melt(cor_matrix)\n",
    "\n",
    "# Create the heatmap plot\n",
    "heatmap_plot <- ggplot(cor_matrix_melted, aes(Var1, Var2, fill = value, label = round(value, 2))) +\n",
    "  geom_tile(color = \"white\") +\n",
    "  scale_fill_gradient2(low = \"blue\", mid = \"white\", high = \"red\", midpoint = 0, limit = c(-1, 1)) +\n",
    "  geom_text(aes(label = round(value, 2)), vjust = 1) +\n",
    "  theme_minimal() +\n",
    "  theme(axis.text.x = element_text(angle = 45, hjust = 1)) +\n",
    "  labs(title = \"Correlation Heatmap\") +\n",
    "  theme(plot.margin = ggplot2::margin(1, 1, 1, 1, \"mm\")) +  # Use ggplot2::margin\n",
    "  theme(legend.position = \"bottom\") +\n",
    "  theme(legend.direction = \"horizontal\") +\n",
    "  theme(legend.title = element_blank()) +\n",
    "  theme(legend.text = element_text(size = 10)) +\n",
    "  theme(axis.text = element_text(size = 10)) +\n",
    "  theme(axis.title = element_text(size = 12))\n",
    "\n",
    "# Save the plot\n",
    "ggsave(\"correlation_heatmap_train.png\", heatmap_plot, width = 14, height = 10, units = \"in\")\n",
    "heatmap_plot"
   ]
