   "source": [
    "I see that MaxOfUpperTRange, MinOfUpperTRange, AverageOfUpperTRange,MaxOfLowerTRange, MinOfLowerTRange and AverageOfLowerTRange are all perfectly correlated (r=1) with eachother. With performance of the model in mind, I must address this; keeping all of them will introduce issues with multicollinearity, which is a detriment to the accuracy. This is also the case for RainingDays and AverageRainingDays. Selecting the variable I want to keep is important. The rest can be removed since they offer no additional benefit to model building/performance (if I am doing a regression with no penalty).\n",
    "\n",
    "However, I could use a regression with penalty to make sure it accounts for these things. "
   ]
  },
  {
   "cell_type": "markdown",
   "id": "ce80d71c",
   "metadata": {
    "papermill": {
     "duration": 0.038947,
     "end_time": "2023-12-06T16:56:02.194143",
     "exception": false,
     "start_time": "2023-12-06T16:56:02.155196",
     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "In this case, a ridge penalty may be best suited. \n",
    "\n",
    "- Ridge regression adds a penalty term to the linear regression objective function, which is the sum of squared coefficients multiplied by a regularization parameter (lambda or alpha).\n",
    "- The penalty term discourages extreme values in the coefficients, helping to stabilize the estimates.\n",
    "- Ridge regression does not perform variable selection; it shrinks all coefficients towards zero.\n",
    "\n",
    "**Since the predictors are perfectly correlated, Ridge regression may be a more suitable choice to stabilize the estimates without arbitrarily excluding any of the correlated predictors (like a lasso regression). However, it's recommended to cross-validate different regularization strengths to find the optimal value for lambda (or alpha) based on your specific data. Cross-validation helps in selecting a regularization strength that balances the bias-variance tradeoff effectively.**\n",
    "\n",
    "In this analysis, I will run a regression with no penalty, a regression with ridge penalty, and a regression with lasso penalty to see which model performs the best."
   ]
  },
