    "require(ggplot2)\n",
    "# checking the high correlation\n",
    "ggplot()+\n",
    "  geom_point(aes(y=baked_train_tr$yield,x=predicted_train_tr))+\n",
    "  xlab('Model Predictions of Yield')+\n",
    "  ylab('Observed Yield')+\n",
    "  theme_bw()+\n",
    "  ggtitle('Model Performance in the Train_tr Dataset')"
   ]
  },
