   "source": [
    "It is too good to be true! As suspected, the model predictions are unusually good in the training data because we are fitting a super complex model, and we are overfitting. This is why I should never judge how well a model is by looking at the performance of the model on the dataset it is trained on.\n",
    "\n",
    "When you fit a model using a dataset, and then use the same dataset to measure the model performance, the same thing happens. We will overestimate the model's predictive power on unseen datasets.\n",
    "\n",
    "Let's check how well this model does on the test data which we didn't use in the estimation.\n"
   ]
  },
