    "# first obtain the predictions according to the model for the observations\n",
    "# in the test dataset\n",
    "\n",
    "predicted_train_te <- predict(mod,newdata=baked_train_te)\n",
    "\n",
    "# Calculate the outcome metrics\n",
    "\n",
