   "source": [
    "Now, I will compare the model's performance on the train_tr set and train_te set. Where do you see the difference?\n",
    "\n",
    "The model performance was stable between the two, and the RMSE was actually better in the train-test data, suggesting I did not overfit the model; the specific noise in the train_tr set that has been used as information when estimating the model parameters does well to generalize to a different dataset. If I am planning to use this model for any future prediction, it is much better to consider the performance on the test data as it will be a more realistic picture of model performance."
   ]
  },
