    "tags": []
   },
   "source": [
    "One way of obtaining realistic performance values while we train the dataset is to use k-fold cross validation. The code below first creates 10 folds for the training dataset. Then, it fits the model using the nine folds while it evaluates the performance on the tenth fold.\n",
    "\n",
    "**Model Fitting Using the caret package**\n",
    "\n",
    "Packages like caret provide built-in functions for conducting cross-validation and also bring several user-friendly experiences in modeling. caret provides a standardized user experience for fitting many different models beyond linear regression. So, one doesn't have to learn the nuances of all different types of functions to fit different types of models. Packages like caret provide a more consistent workflow while working with different types of models. On the other hand, this also brings less flexibility. During this class, I will try to demonstrate both how to work with direct functions and how to work with caret for fitting different types of models.\n",
    "\n",
    "Below is how one could implement the whole process using the caret package."
   ]
  },
