   "source": [
    "**Fitting the models to k-folds**"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 18,
   "id": "7fbe3bc0",
   "metadata": {
    "execution": {
     "iopub.execute_input": "2023-12-06T16:56:14.005625Z",
     "iopub.status.busy": "2023-12-06T16:56:14.003950Z",
