   },
   "outputs": [],
   "source": [
    "#Create empty vectors for performance measures\n",
    "\n",
    "    rsq  <- c()\n",
    "    mae  <- c()\n",
    "    mse  <- c()\n",
    "    rmse <- c()\n",
    "\n",
    "# Fit the model by excluding one of the folds, and then evaluate the performance\n",
    "# on the excluded fold\n",
    "\n",
    "    for(i in 1:10){\n",
    "\n",
    "      data_train_tr <- baked_train_tr[which(folds!=i),] # observation from the remaining 9 folds after excluding Fold i\n",
    "                                            # temporary training set\n",
    "\n",
    "      data_train_te <- baked_train_tr[which(folds==i),] # observation from Fold i, temporary training set  \n",
    "\n",
    "      mod  <- lm(yield ~ .,data=data_train_tr)   # Fit the model to the temporary training set\n",
    "\n",
    "      pred <- predict(mod,newdata=data_train_te)  # Predict the outcome for the temporary test set\n",
    "\n",
    "      rsq[i]  <- cor(data_train_te$yield,pred)^2             # Compute R-square and save the value\n",
    "      mae[i]  <- mean(abs(data_train_te$yield - pred))       # Compute the Mean Absolute Error and save the value\n",
    "      rmse[i] <- sqrt(mean((data_train_te$yield - pred)^2))  # Compute the Root Mean Squared Error and save the value\n",
    "\n",
    "      #cat(paste0('Fold ',i,' is completed.'),'\\n')\n",
    "    }"
   ]
  },
