    "# Blueprint to process variables using the recipes package\n",
    "require(recipes)\n",
    "blueprint <- recipe(x     = train_set,\n",
    "                    vars  = colnames(train_set),\n",
    "                    roles = c('id',rep('predictor',16),'outcome')) %>%\n",
    "             step_zv(all_numeric()) %>%\n",
    "             step_nzv(all_numeric()) %>% \n",
    "             step_normalize(all_numeric_predictors()) # normalizing all numeric predictors\n",
    "\n",
    "blueprint"
   ]
  },
