   "source": [
    "Remember that when λ is zero, it is equivalent of traditional OLS regression with my 16 predictors.\n",
    "\n",
    "By increasing the value lf λ, we are trying to reduce the model variance in exchange of some bias; and, the model will perform better for unseen data as long as the performance gain from variance reduction is more than the performance loss due to increased bias. It is a trade-off.\n",
    "\n",
    "In this case, after λ exceeds 118. that trade-off starts working agains us yielding a worse total model performance. So, we can decide to choose 118 for λ. \n",
    "This is what is called hyperparameter tuning; trying so many values of a hyperparameter and then finding an optimal value that yields the best model performance.\n",
    "\n",
    "Let's check the model performance for the optimal λ of 118\n",
    "value. "
   ]
  },
