   "source": [
    "#elbow method to determine optimal number of clusters\n",
    "# bumbles\n",
    "wcss <- numeric(length = 11)\n",
    "for (i in 1:11) {\n",
    "  kmeans_model <- kmeans(train_set$bumbles, centers = i)\n",
    "  wcss[i] <- kmeans_model$tot.withinss\n",
    "}\n",
    "plot(1:11, wcss, type = \"b\", main = \"Elbow Method\", xlab = \"Number of Clusters (k)\", ylab = \"WCSS\")\n",
    "# so, for bumbles, split into 2"
   ]
