   "source": [
    "#elbow method to determine optimal number of clusters\n",
    "# osmia\n",
    "wcss <- numeric(length = 14)\n",
    "for (i in 1:14) {\n",
    "  kmeans_model <- kmeans(train_set$osmia, centers = i)\n",
    "  wcss[i] <- kmeans_model$tot.withinss\n",
    "}\n",
    "plot(1:14, wcss, type = \"b\", main = \"Elbow Method\", xlab = \"Number of Clusters (k)\", ylab = \"WCSS\")\n",
    "# so, for osmia, split into 7"
   ]
