   "source": [
    "# Histograms\n",
    "\n",
    "# Function to create histograms\n",
    "plot_histogram <- function(data, variable) {\n",
    "  ggplot(data, aes(x = !!sym(variable), fill = \"blue\")) +\n",
    "    geom_histogram(alpha = 0.5, bins = 10, color = 'white', position = 'identity', aes(y = after_stat(density)), show.legend = FALSE) +\n",
    "    labs(title = variable) +\n",
    "    theme_minimal()\n",
    "}\n",
    "\n",
    "# Create subplots using facet_wrap\n",
    "plots <- lapply(setdiff(names(train_set), \"yield\"), function(col) {\n",
    "  plot_histogram(train_set, col)\n",
    "})\n",
    "\n",
    "# Display subplots\n",
    "multiplot <- cowplot::plot_grid(plotlist = plots, ncol = 3, byrow = TRUE, labels = \"AUTO\")\n",
    "print(multiplot)"
   ]
  },
