    "# Here I am splitting the train set to do cross-validation\n",
    "# Initial data preparation\n",
    "\n",
    "require(caret)\n",
    "require(recipes)\n",
    "\n",
    "set.seed(10152021)  # for reproducibility\n",
    "\n",
    "# Train/Test Split\n",
    "  \n",
    "loc      <- sample(1:nrow(train_set), round(nrow(train_set) * 0.9))\n",
    "train_tr  <- train_set[loc, ]\n",
    "train_te  <- train_set[-loc, ]"
   ]
