   "source": [
    "#elbow method to determine optimal number of clusters\n",
    "# clonesize\n",
    "wcss <- numeric(length = 6)\n",
    "for (i in 1:6) {\n",
    "  kmeans_model <- kmeans(train_set$clonesize, centers = i)\n",
    "  wcss[i] <- kmeans_model$tot.withinss\n",
    "}\n",
    "plot(1:6, wcss, type = \"b\", main = \"Elbow Method\", xlab = \"Number of Clusters (k)\", ylab = \"WCSS\")\n",
    "# so, for clone size, split into 2\n",
    "\n"
   ]
