   "source": [
    "#elbow method to determine optimal number of clusters\n",
    "# honeybee\n",
    "wcss <- numeric(length = 7)\n",
    "for (i in 1:7) {\n",
    "  kmeans_model <- kmeans(train_set$honeybee, centers = i)\n",
    "  wcss[i] <- kmeans_model$tot.withinss\n",
    "}\n",
    "plot(1:7, wcss, type = \"b\", main = \"Elbow Method\", xlab = \"Number of Clusters (k)\", ylab = \"WCSS\")\n",
    "# so, for honeybee, split into 4"
   ]
