   "source": [
    "#elbow method to determine optimal number of clusters\n",
    "# andrena\n",
    "wcss <- numeric(length = 16)\n",
    "for (i in 1:16) {\n",
    "  kmeans_model <- kmeans(train_set$andrena, centers = i)\n",
    "  wcss[i] <- kmeans_model$tot.withinss\n",
    "}\n",
    "plot(1:16, wcss, type = \"b\", main = \"Elbow Method\", xlab = \"Number of Clusters (k)\", ylab = \"WCSS\")\n",
    "# so, for andrena, split into 7"
   ]
